-- ----------------------------
--  Table structure for job_jobclass
-- ----------------------------
DROP TABLE IF EXISTS "public"."job_jobclass";
CREATE TABLE "public"."job_jobclass" (
	"id" int8 NOT NULL DEFAULT nextval('seq_job_jobclass'::regclass),
	"name" varchar(100) COLLATE "default",
	"job_type" int4,
	"class_name" varchar(200) COLLATE "default",
	"remark" varchar(200) COLLATE "default",
	"version" varchar(20) COLLATE "default",
	"create_date" date,
	"createby_id" int8,
	"update_date" date,
	"updateby_id" int8,
	"method_name" varchar(200) COLLATE "default",
	"check_label" int4
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."job_jobclass" OWNER TO "postgres";

COMMENT ON COLUMN "public"."job_jobclass"."id" IS 'id';
COMMENT ON COLUMN "public"."job_jobclass"."name" IS '名称';
COMMENT ON COLUMN "public"."job_jobclass"."job_type" IS 'job类别';
COMMENT ON COLUMN "public"."job_jobclass"."class_name" IS '类';
