-- ----------------------------
--  Table structure for job_activity_class
-- ----------------------------
DROP TABLE IF EXISTS "public"."job_activity_class";
CREATE TABLE "public"."job_activity_class" (
	"id" int8 NOT NULL,
	"name" varchar NOT NULL COLLATE "default",
	"code" varchar(50) NOT NULL COLLATE "default",
	"method_name" varchar(50) COLLATE "default",
	"params" text COLLATE "default",
	"remark" varchar(200) COLLATE "default",
	"output" text COLLATE "default"
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."job_activity_class" OWNER TO "postgres";

COMMENT ON TABLE "public"."job_activity_class" IS '流程接点类';
COMMENT ON COLUMN "public"."job_activity_class"."params" IS '参数定义json';
COMMENT ON COLUMN "public"."job_activity_class"."output" IS '输出定义json';

-- ----------------------------
--  Table structure for job_activity
-- ----------------------------
DROP TABLE IF EXISTS "public"."job_activity";
CREATE TABLE "public"."job_activity" (
	"id" int8 NOT NULL,
	"act_class_id" int8,
	"name" varchar COLLATE "default",
	"params" text COLLATE "default",
	"icon" varchar(20) COLLATE "default",
	"style" varchar(200) COLLATE "default",
	"activity_type" int2 DEFAULT 0,
	"flow_id" int8,
	"remark" varchar(200) COLLATE "default"
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."job_activity" OWNER TO "postgres";

COMMENT ON COLUMN "public"."job_activity"."activity_type" IS '节点类型 1-表示开始节点 -1 表示完成节点 0-流程中执行接点';

-- ----------------------------
--  Table structure for job_activity_result
-- ----------------------------
DROP TABLE IF EXISTS "public"."job_activity_result";
CREATE TABLE "public"."job_activity_result" (
	"id" int8 NOT NULL,
	"activity_id" int8 NOT NULL,
	"result_value" varchar NOT NULL COLLATE "default",
	"process_to" varchar NOT NULL COLLATE "default"
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."job_activity_result" OWNER TO "postgres";

COMMENT ON COLUMN "public"."job_activity_result"."result_value" IS '结果值';
COMMENT ON COLUMN "public"."job_activity_result"."process_to" IS '处理节点 -9表示结束';

-- ----------------------------
--  Table structure for job_execution_info
-- ----------------------------
DROP TABLE IF EXISTS "public"."job_execution_info";
CREATE TABLE "public"."job_execution_info" (
	"id" int8 NOT NULL DEFAULT nextval('seq_job_execution_info'::regclass),
	"item" int4,
	"failover_ip" varchar(200) COLLATE "default",
	"last_begin_time" timestamp(6) NULL,
	"last_complete_time" timestamp(6) NULL,
	"next_fire_time" timestamp(6) NULL,
	"status" varchar(20) COLLATE "default",
	"worker_id" int8,
	"machine_id" int8,
	"reg_id" int8,
	"exe_result" varchar(50) COLLATE "default",
	"log" text COLLATE "default",
	"object_type" int4 DEFAULT 0
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."job_execution_info" OWNER TO "postgres";

COMMENT ON COLUMN "public"."job_execution_info"."item" IS '分片';
COMMENT ON COLUMN "public"."job_execution_info"."failover_ip" IS '分片转移';
COMMENT ON COLUMN "public"."job_execution_info"."last_begin_time" IS '上次作业开始时间';
COMMENT ON COLUMN "public"."job_execution_info"."last_complete_time" IS '上次作业完成时间';
COMMENT ON COLUMN "public"."job_execution_info"."next_fire_time" IS '下次作业运行时间';
COMMENT ON COLUMN "public"."job_execution_info"."status" IS '状态';
COMMENT ON COLUMN "public"."job_execution_info"."worker_id" IS '任务ID';
COMMENT ON COLUMN "public"."job_execution_info"."object_type" IS '0-调度任务日志 1-流程日志';

