--  Table structure for etl_job_execution
-- ----------------------------
DROP TABLE IF EXISTS "public"."etl_job_execution";
CREATE TABLE "public"."etl_job_execution" (
	"id" int8 NOT NULL,
	"exe_time" timestamp(6) NULL,
	"job_id" int8,
	"job_exe_id" int8,
	"remark" varchar COLLATE "default"
)
WITH (OIDS=FALSE);
ALTER TABLE "public"."etl_job_execution" OWNER TO "postgres";

COMMENT ON COLUMN "public"."etl_job_execution"."exe_time" IS '执行时间';
COMMENT ON COLUMN "public"."etl_job_execution"."job_id" IS 'etl job id';
COMMENT ON COLUMN "public"."etl_job_execution"."job_exe_id" IS '调度执行时execute_id,非调度执行未空';

